 import styled from 'styled-components';
 const Patata = styled.form`
 background-color: goldenrod;
 display: flex;
 flex-direction: column;`;
 const LetmyIn = styled.input` width: 20%;
 display: flex;
 flex-direction: row;`
 const Form = ()=>{
    
    return(
        <Patata>
            <label htmlFor="">
                username</label>
                <LetmyIn type='text' name='username'></LetmyIn> 
                <label htmlFor="">
                password</label>
                <input type='text' name='password'></input>    
                <button type='submit'>Login</button>         
        </Patata>
    )
}
export default Form
